    h = [[0] * m for _ in range(n)]
    tmp = g0
    for i in range(n):
        for j in range(m):
            h[i][j] = tmp
            tmp = (tmp * x + y) % z
    for i in range(n):
        h[i] = slide_min(m, b, h[i])
